  return(data.map((d) => <li>{d.name}</li>));
}

function Capabilities() {
  return (
//    <li>{listItems(copy.Capabilities.Materials.Aluminum)}</li>
//    <li>{IdiomaticReactList(copy.Capabilities.Materials.Aluminum)}</li>
    <ul>
      {listItems(aluminums)}
    </ul>
  );
}

export default Capabilities;
